// import { ADD_NEWONE_TASK } from "../constants";
import { SHOW_ALL } from "../constants";
import { SHOW_ACTIVE } from "../constants";
import { SHOW_COMPLETED } from "../constants";

const currentFilter = (state = SHOW_ALL, actions: any) => {
  switch (actions.type) {
    case SHOW_ACTIVE:
      return;
    case SHOW_COMPLETED:
      return;
    default:
      return state;
  }
};

export default currentFilter;
